  false,\n\t\"url\": null,\n\t\"notes\": \"This Historical North Atlantic Tropical
  Cyclone Tracks file contains the six-hourly (0000, 0600, 1200, 1800 UTC) center
  locations and intensities for all northern Atlantic subtropical depressions and
  storms, extratropical storms, tropical lows, waves, disturbances, depressions and
  storms, and all hurricanes, from 1851 through 2004. Included are storms in the Caribbean
  Sea and the Gulf of Mexico. This is a replacement for the January 2005 map layer
  distributed as Historical North Atlantic Tropical Cyclone Tracks, 1851-2003.\",\n\t\"license_title\":
